// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./BitcoinNetflowContract.sol";
import "../interfaces/Interfaces.sol"; // Chứa IDashboardRegistry và IDataSpecificContract_Netflow

contract DashboardFactory is Ownable {
    IDashboardRegistry public dashboardRegistry;

    mapping(string => address) public deployedDataContracts;

    event DataContractDeployed(string indexed dataType, address contractAddress);

    constructor(address _dashboardRegistryAddress) Ownable(msg.sender) {
        require(_dashboardRegistryAddress != address(0), "Factory: Invalid dashboard registry address");
        dashboardRegistry = IDashboardRegistry(_dashboardRegistryAddress);
    }

    function createBitcoinNetflowContract() external onlyOwner {
        string memory dataType = "bitcoinNetflow";
        require(deployedDataContracts[dataType] == address(0), "Factory: BitcoinNetflow contract already deployed");

        BitcoinNetflowContract btcContract = new BitcoinNetflowContract(address(this), address(dashboardRegistry));
        deployedDataContracts[dataType] = address(btcContract);

        dashboardRegistry.registerDataContract(dataType, address(btcContract));
        emit DataContractDeployed(dataType, address(btcContract));
    }

    // Các hàm create...Contract khác cho Stablecoin, Narrative, etc.

    function factoryUpdateBitcoinNetflow(int256 _amount) external onlyOwner {
        address btcContractAddress = deployedDataContracts["bitcoinNetflow"];
        require(btcContractAddress != address(0), "Factory: BitcoinNetflow contract not deployed");
        IDataSpecificContract_Netflow(btcContractAddress).updateNetflow(_amount);
    }
}

