// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";
import "../../structs/DataTypes.sol";
import "../interfaces/Interfaces.sol";

contract BitcoinNetflowContract is Ownable {
    using DataTypes for DataTypes.NetflowInfo;
    using DataTypes for DataTypes.AlertConfig;

    DataTypes.NetflowInfo public currentNetflow;
    int256 public previousNetflowAmount;
    bool public hasPreviousNetflowAmount = false;

    DataTypes.AlertConfig public netflowAlert;
    uint256 private nextAlertIdInternal = 1;

    IDashboardNotifier public dashboardNotifier;

    event NetflowUpdated(DataTypes.NetflowInfo netflow);
    event AlertConfigured(uint256 indexed alertId, DataTypes.AlertConfig config);
    event AlertTriggered(uint256 indexed alertId, int256 currentValue, string message);
    event AlertDeactivated(uint256 indexed alertId);
    event AlertActivated(uint256 indexed alertId);
    event AlertTriggerReset(uint256 indexed alertId);

    constructor(address _initialOwner, address _dashboardNotifierAddress) Ownable(_initialOwner) {
        if (_dashboardNotifierAddress != address(0)) {
            dashboardNotifier = IDashboardNotifier(_dashboardNotifierAddress);
        }
        netflowAlert.isActive = false;
        netflowAlert.id = 0;
    }

    function setDashboardNotifier(address _dashboardNotifierAddress) external onlyOwner {
        dashboardNotifier = IDashboardNotifier(_dashboardNotifierAddress);
    }

    function updateNetflow(int256 _amount) external onlyOwner {
        if (hasPreviousNetflowAmount || currentNetflow.lastUpdatedAt != 0) {
            previousNetflowAmount = currentNetflow.amount;
        } else {
            previousNetflowAmount = _amount;
        }
        hasPreviousNetflowAmount = true;

        currentNetflow.amount = _amount;
        currentNetflow.lastUpdatedAt = block.timestamp;
        emit NetflowUpdated(currentNetflow);

        if (address(dashboardNotifier) != address(0)) {
            dashboardNotifier.notifyNetflowUpdate(currentNetflow);
        }

        checkAndTriggerAlert(currentNetflow.amount, previousNetflowAmount, hasPreviousNetflowAmount);
    }

    function configureSingleThresholdAlert(
        DataTypes.AlertCondition _condition,
        int256 _threshold1,
        string calldata _message
    ) external onlyOwner {
        require(
            _condition == DataTypes.AlertCondition.GREATER_THAN ||
            _condition == DataTypes.AlertCondition.LESS_THAN ||
            _condition == DataTypes.AlertCondition.EQUAL_TO ||
            _condition == DataTypes.AlertCondition.CROSSING ||
            _condition == DataTypes.AlertCondition.CROSSING_UP ||
            _condition == DataTypes.AlertCondition.CROSSING_DOWN ||
            _condition == DataTypes.AlertCondition.MOVING_UP ||
            _condition == DataTypes.AlertCondition.MOVING_DOWN,
            "BitcoinNetflow: Invalid condition for single threshold"
        );

        if (netflowAlert.id == 0) {
            netflowAlert.id = nextAlertIdInternal++;
        }
        netflowAlert.user = msg.sender;
        netflowAlert.condition = _condition;
        netflowAlert.threshold1 = _threshold1;
        netflowAlert.threshold2 = 0;
        netflowAlert.message = _message;
        netflowAlert.isActive = true;
        netflowAlert.isTriggered = false;
        netflowAlert.lastTriggeredAt = 0;
        emit AlertConfigured(netflowAlert.id, netflowAlert);
    }

    function configureChannelAlert(
        DataTypes.AlertCondition _condition,
        int256 _bound1,
        int256 _bound2,
        string calldata _message
    ) external onlyOwner {
        require(
            _condition == DataTypes.AlertCondition.ENTERING_CHANNEL ||
            _condition == DataTypes.AlertCondition.EXITING_CHANNEL ||
            _condition == DataTypes.AlertCondition.INSIDE_CHANNEL ||
            _condition == DataTypes.AlertCondition.OUTSIDE_CHANNEL,
            "BitcoinNetflow: Invalid condition for channel alert"
        );
        require(_bound1 != _bound2, "BitcoinNetflow: Channel bounds must be different");

        if (netflowAlert.id == 0) {
            netflowAlert.id = nextAlertIdInternal++;
        }
        netflowAlert.user = msg.sender;
        netflowAlert.condition = _condition;
        if (_bound1 < _bound2) {
            netflowAlert.threshold1 = _bound1;
            netflowAlert.threshold2 = _bound2;
        } else {
            netflowAlert.threshold1 = _bound2;
            netflowAlert.threshold2 = _bound1;
        }
        netflowAlert.message = _message;
        netflowAlert.isActive = true;
        netflowAlert.isTriggered = false;
        netflowAlert.lastTriggeredAt = 0;
        emit AlertConfigured(netflowAlert.id, netflowAlert);
    }

    function checkAndTriggerAlert(int256 _currentValue, int256 _previousValue, bool _hasPreviousValue) internal {
        if (!netflowAlert.isActive || netflowAlert.isTriggered || netflowAlert.id == 0) return;

        bool triggered = false;
        DataTypes.AlertCondition condition = netflowAlert.condition;
        int256 threshold1 = netflowAlert.threshold1;
        int256 lowerChannelBound = netflowAlert.threshold1;
        int256 upperChannelBound = netflowAlert.threshold2;

        if (condition == DataTypes.AlertCondition.GREATER_THAN) {
            if (_currentValue > threshold1) triggered = true;
        } else if (condition == DataTypes.AlertCondition.LESS_THAN) {
            if (_currentValue < threshold1) triggered = true;
        } else if (condition == DataTypes.AlertCondition.EQUAL_TO) {
            if (_currentValue == threshold1) triggered = true;
        } else if (_hasPreviousValue) {
            if (condition == DataTypes.AlertCondition.CROSSING) {
                if ((_previousValue < threshold1 && _currentValue >= threshold1) ||
                    (_previousValue > threshold1 && _currentValue <= threshold1)) triggered = true;
            } else if (condition == DataTypes.AlertCondition.CROSSING_UP) {
                if (_previousValue < threshold1 && _currentValue >= threshold1) triggered = true;
            } else if (condition == DataTypes.AlertCondition.CROSSING_DOWN) {
                if (_previousValue > threshold1 && _currentValue <= threshold1) triggered = true;
            } else if (condition == DataTypes.AlertCondition.ENTERING_CHANNEL) {
                bool previouslyOutside = (_previousValue < lowerChannelBound || _previousValue > upperChannelBound);
                bool currentlyInside = (_currentValue >= lowerChannelBound && _currentValue <= upperChannelBound);
                if (previouslyOutside && currentlyInside) triggered = true;
            } else if (condition == DataTypes.AlertCondition.EXITING_CHANNEL) {
                bool previouslyInside = (_previousValue >= lowerChannelBound && _previousValue <= upperChannelBound);
                bool currentlyOutside = (_currentValue < lowerChannelBound || _currentValue > upperChannelBound);
                if (previouslyInside && currentlyOutside) triggered = true;
            } else if (condition == DataTypes.AlertCondition.INSIDE_CHANNEL) {
                if (_currentValue >= lowerChannelBound && _currentValue <= upperChannelBound) triggered = true;
            } else if (condition == DataTypes.AlertCondition.OUTSIDE_CHANNEL) {
                if (_currentValue < lowerChannelBound || _currentValue > upperChannelBound) triggered = true;
            } else if (condition == DataTypes.AlertCondition.MOVING_UP) {
                if (_currentValue > _previousValue) triggered = true;
            } else if (condition == DataTypes.AlertCondition.MOVING_DOWN) {
                if (_currentValue < _previousValue) triggered = true;
            }
        }

        if (triggered) {
            netflowAlert.isTriggered = true;
            netflowAlert.lastTriggeredAt = block.timestamp;
            emit AlertTriggered(netflowAlert.id, _currentValue, netflowAlert.message);
            if (address(dashboardNotifier) != address(0)) {
                dashboardNotifier.notifyAlertTriggered(netflowAlert.id, netflowAlert.user, netflowAlert.message);
            }
        }
    }

    function turnOffAlert() external onlyOwner {
        if(netflowAlert.id != 0 && netflowAlert.isActive){
            netflowAlert.isActive = false;
            emit AlertDeactivated(netflowAlert.id);
        }
    }

    function activateAlert() external onlyOwner {
         if(netflowAlert.id != 0 && !netflowAlert.isActive){
            netflowAlert.isActive = true;
            netflowAlert.isTriggered = false;
            emit AlertActivated(netflowAlert.id);
        }
    }

    function resetAlertTriggerState() external onlyOwner {
        if(netflowAlert.id != 0 && netflowAlert.isTriggered) {
            netflowAlert.isTriggered = false;
            emit AlertTriggerReset(netflowAlert.id);
        }
    }

    function getCurrentNetflow() external view returns (DataTypes.NetflowInfo memory) {
        return currentNetflow;
    }
}

