// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

library DataTypes {
    struct NetflowInfo {
        int256 amount;
        uint256 lastUpdatedAt;
    }

    struct StablecoinOverallInfo {
        int256 dailyNetflowSum;
        int256 weeklyNetflowSum;
        int256 monthlyNetflowSum;
        int256 marketCapChangePercent;
        uint256 lastUpdatedAt;
    }

    struct NarrativePerformanceInfo {
        string name;
        int256 performancePercent24h;
        uint256 lastUpdatedAt;
    }

    struct AssetPerformanceInfo {
        string tokenSymbol;
        address tokenAddress;
        int256 performancePercent24h;
        int256 performanceVsMarketPercent;
        uint256 lastUpdatedAt;
    }

    enum AlertCondition {
        NONE, GREATER_THAN, LESS_THAN, EQUAL_TO, CROSSING, CROSSING_UP, CROSSING_DOWN,
        ENTERING_CHANNEL, EXITING_CHANNEL, INSIDE_CHANNEL, OUTSIDE_CHANNEL,
        MOVING_UP, MOVING_DOWN
    }

    struct AlertConfig {
        uint256 id;
        address user;
        AlertCondition condition;
        int256 threshold1;
        int256 threshold2;
        bool isActive;
        bool isTriggered;
        uint256 lastTriggeredAt;
        string message;
    }
}

